import React from "react";
import styled from "styled-components";

const CoalWrapper = styled.section`
  width: 100vw;
  min-height: 100vh;
  background-color: D8D6C8
`;

const Coal = () => {
  return <CoalWrapper></CoalWrapper>;
};


export default Coal;
